export class StandingsTeam{
    constructor(public id:number, public conferenceStandingsPlace:number, public divisionStandingsPlace:number, public teamName:string, public record:string, public points:number, public pointsPercentage:number){
        this.id = id;
        this.conferenceStandingsPlace = conferenceStandingsPlace;
        this.divisionStandingsPlace = divisionStandingsPlace;
        this.teamName = teamName;
        this.record = record;
        this.points = points;
        this.pointsPercentage = pointsPercentage;
    }
}
